import React, { useState, useEffect } from 'react';
import '../../App.css';
import styles from './contacts.module.css'
import ReactMapGL, { GeolocateControl } from 'react-map-gl';
import mapboxgl from 'mapbox-gl';


function Contacts() {
    const [viewport, setViewport] = useState({
        latitude: 0,
        longitude: 0,
        zoom: 12
      });

      useEffect(() => {
        mapboxgl.accessToken = process.env.REACT_APP_MAPBOX_TOKEN;
        const geocoder = new mapboxgl.Geocoder({
          accessToken: mapboxgl.accessToken
        });

        geocoder.geocode('1600 Amphitheatre Parkway, Mountain View, CA', (result) => {
          setViewport({
            latitude: result.features[0].center[1],
            longitude: result.features[0].center[0],
            zoom: 12
          });
        });
      }, []);

  return (
    <div>
        <ReactMapGL
      {...viewport}
      width="100%"
      height="100%"
      onViewportChange={setViewport}
      mapboxApiAccessToken={process.env.REACT_APP_MAPBOX_TOKEN}
    >
      <GeolocateControl positionOptions={{ enableHighAccuracy: true }} />
    </ReactMapGL>
    </div>
  );
}

export default Contacts;
